import StaffConsultations from './staffConsultation'
import ConsultationList from "./consultationList"
//import FilterComponent from "./consultationList"
import FilterData from "./filterData"

const sampleData = [
  {
    id: 1,
    date: '2024-05-01',
    patientName: 'John Doe',
    healthcareProvider: 'Dr. Smith',
    consultationType: 'Routine Check-up',
    medicalCondition: 'Hypertension'
  },
  {
    id: 2,
    date: '2024-05-02',
    patientName: 'Jane Doe',
    healthcareProvider: 'Dr. Brown',
    consultationType: 'Emergency',
    medicalCondition: 'Diabetes'
  },
  // Add more sample data as needed
];


const Home = () => {
  return (
    < div >   


           <div>
           <FilterData data={sampleData}/>
           </div>
            

            
           
    </div>
  )
}

export default Home
